- input: "TEXT\x1CC00188367\x1CTEXT-00002\x1C\x1CF3XA\x1CWe are in receipt of your
    letter dated 12/31/08. The totals on the Summary Page have been corrected. The
    discrepancy occurred due to the amendment of a previous report.   The original
    report included itemized transactions for in-kind contributions on Schedule A
    and  Schedule B. However, we realized that not all were marked In-kind. We have
    made this correction and they have been properly linked.   Expenditures for Fundraising
    expenses were for generic State Party fundraising and not on behalf of any Federal
    candidates. The expenditure Deposit was a Rent/Security deposit.   Please note
    that transfers from the Democratic National Committee, Democratic Senatorial Campaign
    Committe and the Democratic Congressional Campaign Committee were deposited in
    a segregated account and not used for any Exempt Activity."
